package gov.ca.cwds.data.persistence.cms;

import static org.junit.Assert.assertTrue;
import static org.junit.Assert.fail;
import static org.mockito.ArgumentMatchers.any;
import static org.mockito.Mockito.doAnswer;
import static org.mockito.Mockito.doReturn;
import static org.mockito.Mockito.mock;
import static org.mockito.Mockito.when;

import java.io.File;
import java.io.FileOutputStream;

import javax.xml.bind.DatatypeConverter;

import org.hamcrest.junit.ExpectedException;
import org.junit.Before;
import org.junit.Rule;
import org.junit.Test;
import org.mockito.invocation.InvocationOnMock;
import org.mockito.stubbing.Answer;

import gov.ca.cwds.data.cms.CmsDocumentDao;
import gov.ca.cwds.rest.api.domain.DomainChef;
import gov.ca.cwds.rest.util.Doofenshmirtz;
import gov.ca.cwds.rest.util.jni.LZWEncoder;

/**
 * JUnit tests for {@link CmsDocumentDao}.
 * 
 * @author CWDS API Team
 */
public class CmsDocumentDaoTest extends Doofenshmirtz<CmsDocument> {

  @Rule
  public ExpectedException thrown = ExpectedException.none();

  private LZWEncoder lzw;

  private CmsDocumentDao cut; // "class under test"

  @Before
  public void initMocks() throws Exception {
    super.setup();

    lzw = mock(LZWEncoder.class);
    when(lzw.didLibraryLoad()).thenReturn(true);

    cut = new CmsDocumentDao(sessionFactory);
    cut.setLzwSupplier(() -> lzw);
  }

  // ===================
  // DECOMPRESS LZW:
  // ===================

  // Live LZW test runs great in Eclipse (OS X and Windows) and even as the Jenkins user on Linux.
  // However, the Jenkins service isn't loading Linux environment variables as expected.
  @Test
  public void testDecompressLZW() throws Exception {
    final String docHandle = "7759421009100220*ADMINOA 00006";
    CmsDocument doc = new CmsDocument(docHandle // id/doc_handle
        , (short) 1 // segmentCount
        , 1934L // docLength
        , "ADMINOA " // docAuth
        , "D7401W01" // docServ
        , DomainChef.uncookDateString("2002-10-09") // docDate
        , DomainChef.uncookTimeString("10:42:59") // docTime
        , "Testd000.DOC" // docName
        , "CWSCMP01" // compressionMethod
    );

    doc.addBlobSegment(
        new CmsDocumentBlobSegment(docHandle, "0001", DatatypeConverter.parseHexBinary(
            "")));

    doReturn(Boolean.TRUE).when(lzw).didLibraryLoad();

    // Must write the base64-encoded answer to a *file*.
    // Mockito magic:
    doAnswer(new Answer<Void>() {
      @Override
      public Void answer(InvocationOnMock invocation) {
        try {
          File f = new File((String) invocation.getArguments()[1]);
          FileOutputStream fos = new FileOutputStream(f);
          fos.write(DatatypeConverter.parseBase64Binary(
              ""));
          fos.flush();
          fos.close();
        } catch (Exception e) {
        }

        return null;
      }
    }).when(lzw).fileCopyUncompress(any(String.class), any(String.class));

    // Don't call statically cuz you want to construct the DAO and test.
    final String base64Doc = cut.decompressDoc(doc);
    final boolean answer =
        ""
            .equals(base64Doc);

    assertTrue("LZW decompression failed", answer);
  }

  // ===================
  // DECOMPRESS PK:
  // ===================

  @Test
  public void testDecompressPK() {
    try {
      final String docHandle = "3215511513071620*CWDST   00002";
      CmsDocument doc = new CmsDocument(docHandle // id/doc_handle
          , (short) 2 // segmentCount
          , 6881L // docLength
          , "CWDST   " // docAuth
          , "D7701V01" // docServ
          , DomainChef.uncookDateString("2016-07-13") // docDate
          , DomainChef.uncookTimeString("15:51:15") // docTime
          , "ininv.doc" // docName
          , "PKWare02" // compressionMethod
      );

      doc.addBlobSegment(
          new CmsDocumentBlobSegment(docHandle, "0001", DatatypeConverter.parseHexBinary(
              "")));
      doc.addBlobSegment(
          new CmsDocumentBlobSegment(docHandle, "0002", DatatypeConverter.parseHexBinary(
              "")));

      // Don't call statically cuz you want to construct the DAO and test.
      final String base64Doc = cut.decompressDoc(doc);
      final boolean answer =
          ""
              .equals(base64Doc);

      assertTrue("PK decompression failed", answer);
    } catch (Exception e) {
      e.printStackTrace();
      fail("Exception: " + e.getMessage());
    }
  }

}
